import React from 'react';

type BuzzwordCellProps = {
    value: string;
    isMarked: boolean;
    onClick?: () => void;
    isHighlighted: boolean;
};

const BuzzwordCell: React.FC<BuzzwordCellProps> = ({ value, isMarked, onClick }) => {
    return (
        <div className={`buzzword-cell ${isMarked ? 'marked' : ''}`} onClick={onClick}>
            {value}
        </div>
    );
};

export default BuzzwordCell;
